    const [tickets, setTickets] = useState([
        {ticketID: 5, orders: 'water, coke, chips', total: 53.21},
        {ticketID: 2, orders: 'cookie, juice', total: 13.10},
        {ticketID: 3, orders: 'steak, potatoes', total: 125.00}
    ]);


    const handeClick = () => {
        console.log('greetings');
        setMsg('new msg');
        setIdNum(25);
    }

    return (  
        <><React.Fragment>
            <section>
                <div className="w-screen h-screen grid grid-rows-2 text-gray text-4xl md: grid-cols-2">
                    <div className='w- h-full centered md:h-screen'>
                    {< div className="home">
                <h2>Homepage</h2>
                <p>{msg} id num: {idnum} </p>
                <button onClick={handeClick}>hi</button>

                {tickets.map((ticket) => (
                    <div className="ticket-preview" key={ticket.ticketID}>
                        <h2>ticketID: {ticket.ticketID}</h2>
                        <h3>Orders: {ticket.orders}</h3>
                        <p>total: {ticket.total}</p>

                    </div>

                ))}
            </div> }
                    </div>

                    <div className="w-full h-full bg-black centered md:h-screen">
                        <p>Page 2</p>
                    </div>
                </div>
            </section>
        </React.Fragment></>
        /**/
    );
}
 
export default Home;
